        IPayable(receiver).pay{value: msg.value}(serviceName, signature, wallet);
    }
}

// File: contracts/token/ERC20/StandardERC20.sol



pragma solidity ^0.8.0;


/**
 * @title StandardERC20
 * @dev Implementation of the StandardERC20
 */
contract StandardERC20 is ERC20Detailed, ServicePayer {
    constructor(
        string memory name_,
        string memory symbol_,
        uint8 decimals_,
        uint256 initialBalance_,
        bytes memory signature_,
        address payable feeReceiver_
    )
        payable
        ERC20Detailed(name_, symbol_, decimals_)
        ServicePayer(feeReceiver_, "StandardERC20", signature_, _msgSender())
    {
        require(initialBalance_ > 0, "StandardERC20: supply cannot be zero");

        _mint(_msgSender(), initialBalance_);
    }

    function decimals() public view virtual override returns (uint8) {
        return super.decimals();
    }
}

